import './Photos.css';
import React from 'react';
import {Link} from "react-router-dom";
import paramountSign from './webParamountSign.jpg';
import rocks from 'rocks.png';

function Photos() {
  return (
    <div className="Photos-background">
      <header className="Photos-header">
        <div className='Photos-title'>
          <h1 className="Page-title">
            photos
          </h1>
          <Link to="/">
            <button className="Photos-links">
              mainpage
            </button>
          </Link>      
        </div>
      </header>
      <img className='Photo-layout' src={paramountSign}/>
      <img className='Photo-layout' src={rocks}/>
    </div>
  );
}

export default Photos;
